        let retVal = (
            <div className = "Body">
                <div className="container">
                <img src={require('./BANANA.png')} /> 
                </div>

            </div>
        );
        return retVal;
    }
}

function App1() {
  return (
    <div className="App1">
<img src={require('./BANANA.png')} />    </div>
  );
}


function Grid() {
  return (
    <div className="App1">
<img src={require('./BANANA.png')} />    </div>
